import Header from '../components/Header';
import client from '../apollo';
import { ApolloProvider } from '@apollo/client';

export default () => {
  return (
    <ApolloProvider client={client}>
      <Header />
      <div> Welcome to Next.js </div>
    </ApolloProvider>
  );
};
